import React from 'react'
import { FaHospital } from 'react-icons/fa';
import './stylesheet/Dashboard.css'

const Dashboard = () =>
{
    return (
        <>
            <div className='header2'>
                <FaHospital size={ 46 } />
                <h1>Dashboard</h1>
            </div>
        </>
    )
}

export default Dashboard
